import React from 'react';
import ReactDOM from 'react-dom';
import {
  Route,
  NavLink,
  HashRouter
} from "react-router-dom";
import './index.css';
import Blog from './Home.js';
import NavBar from './components/NavBar.js';

class BlogRoot extends React.Component {

  render() {


    return (
      <HashRouter>
        <div className="header">

          <h1>Peaua Blog</h1>

           <h2>My Blog Posts</h2>

            <div className="NavBar">
              <ul>
                <li><NavLink to='./Home'>Blog</NavLink></li>
                <li><NavLink to='/'>About</NavLink></li>
                <li><NavLink to='/'>GitHub</NavLink></li>
                <li><NavLink to='/'>LinkedIn</NavLink></li>
              </ul>
            </div>
        </div>

        <div className="body">
          <Route path='./Home' component={ Blog }/>
          <Blog />
        </div>
      </HashRouter>
    )
  }

}

ReactDOM.render(
  <BlogRoot />,
  document.getElementById('root')
  );
